import React from "react";
import "./CircleIcon.css";

const CircleIcon = ({ fill, width, height }) => {
  return (
    <svg
      aria-hidden="true"
      className="icon icon-radio-unchecked"
      viewBox="0 0 32 32"
      fill={fill}
      width={width}
      height={height}
    >
      <use xlinkHref="#icon-radio-unchecked"></use>
    </svg>
  );
};

export default CircleIcon;
